import React, { useState, useContext } from 'react';
import { AuthContext } from '../context/AuthContext';

const Register = () => {
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');
    const { register } = useContext(AuthContext);

    const handleSubmit = async (e) => {
        e.preventDefault();
        await register(username, password);
    };

    return (
        <form onSubmit={handleSubmit}>
            <input
                type="text"
                placeholder="Username"
                value={username}
                onChange={(e) => setUsername(e.target.value)}
            />
            <input
                type="password"
                placeholder="Password"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
            />
            <button type="submit">Register</button>
        </form>
    );
    return (
        <div id="loginContainer">
            <div id="loginHeader">Login</div>
            <div id="formContainer">
                <form onSubmit={handleSubmit}>
                    <div className="inputGroup">
                        <label id="inputHeading" htmlFor="usernameInput">Email</label>
                        <input
                            id = "usernameInput"
                            type="text"
                            placeholder="example@email.com"
                            value={username}
                            onChange={(e) => setUsername(e.target.value)}
                        />
                    </div>
                    <div className="inputGroup">
                        <label id="inputHeading" htmlFor="passwordInput">Password</label>
                        <input
                            id = "passwordInput"
                            type="password"
                            placeholder="Your password"
                            value={password}
                            onChange={(e) => setPassword(e.target.value)}
                        />
                    </div>
                    <button type="submit" id="loginButton">Log in</button>
                </form>
            </div>
            <div>
                <a id="registerLink" href="/register">Donâ€™t have any account? Sign up</a>
            </div>
        </div>
    );
};

export default Register;
